E_D("replace into `phome_ecms_infotmp_game` values('1684','17','http://www.61baobao.com/tingerge/4046/','0','2012-06-29 02:06:35','爸爸','2012-06-29 02:06:35','4usky','2','1340906795','','http://www.61baobao.com/common/flash/d/pic/4046.jpg','','0','','http://s.61baobao.com/common/flash/d/4046.swf','667','479','爸爸爸爸每天晚回家<br /><br />我知道你是为了我为了咱地家<br /><br />爸爸爸爸多么辛苦呀<br /><br />我有一个小心愿说给你听吧<br /><br />给我一点点给我一点点时间<br /><br />你和我一起玩耍你陪我聊聊天<br /><br />给我一点点给我一点点时间<br /><br />你和我一起做游戏我心比蜜还甜<br /><br /><br />','http://www.61baobao.com/common/flash/d/dpic/4046.jpg','4046','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsRjNUa1JaZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/4046.swf','http://www.61baobao.com/common/flash/d/dpic/4046.jpg','http://www.61baobao.com/common/flash/d/pic/4046.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('1685','17','http://www.61baobao.com/tingerge/4044/','0','2012-06-29 02:06:41','我爱妈妈的眼睛','2012-06-29 02:06:41','4usky','2','1340906801','','http://www.61baobao.com/zt/qinbao/2012/pic/wodihaomama.jpg','','0','','http://s.61baobao.com/zt/qinbao/2012/wodihaomama.swf','667','479','当我在病床上,从昏睡中醒来， <br />就会望见妈妈，那充满抚爱的眼睛。 <br />当我从学校里，捧回一张奖状， <br />就会望见妈妈，那充满欣慰的眼睛。 <br />啊,妈妈的眼睛，我心中温柔的灯， <br />我永远记着她的深情，妈妈的眼睛。 <br />当我和小伙伴， 在外面闯了祸， <br />就会想起妈妈， 那充满诚实的眼睛。 <br />当我在课堂上， 遇到一道难题， 就会想起妈妈， 那充满鼓励的眼睛。 妈妈的眼睛， 我心中明亮的灯， 我永远记着她的叮咛，她的眼睛。','http://www.61baobao.com/zt/qinbao/2012/dpic/wodihaomama.jpg','4044','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU0yUjJXa2RzYjFsWE9YUlpWekZvVEc1T00xcG5QVDA9','http://s.61baobao.com/zt/qinbao/2012/wodihaomama.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/wodihaomama.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/wodihaomama.jpg','三个月以上','0','0','','0');");
