E_D("replace into `phome_ecms_infotmp_game` values('1752','17','http://www.61baobao.com/tingerge/2565/','0','2012-06-29 02:08:18','春天来了［幼儿园大班歌曲］','2012-06-29 02:08:18','4usky','2','1340906898','','http://www.61baobao.com/zt/qinbao/pic/chuntian.jpg','','0','','http://s.61baobao.com/zt/qinbao/chuntian.swf','667','479','小鸟小鸟飞来了,欢聚一起真热闹.<br />动听的歌儿唱起来,叽叽喳喳唱不停<br />春天就要来到了,我们愉快地在歌唱.<br /><br />小鸟小鸟多高兴,自由自在飞翔.<br />山鸟画眉白头翁,整整来了一大群.<br />祝你一年都快乐,身体健康多幸福.<br /><br />小鸟为我们祝福,大家记在心上.<br />我们的生活多欢畅,跳舞游戏又歌唱.<br />在山谷里在田野上,欢乐歌声响四方','http://www.61baobao.com/zt/qinbao/dpic/chuntian.jpg','2565','VEROd01Fd3pSbkJpYlVwb1luazVhbUZJVm5Wa1IyeG9ZbWsxZW1ReVdUMD0=','http://s.61baobao.com/zt/qinbao/chuntian.swf','http://www.61baobao.com/zt/qinbao/dpic/chuntian.jpg','http://www.61baobao.com/zt/qinbao/pic/chuntian.jpg','三个月以上','0','0','','0');");
