E_D("replace into `phome_ecms_infotmp_game` values('1754','17','http://www.61baobao.com/tingerge/2554/','0','2012-06-29 02:08:24','中国话','2012-06-29 02:08:24','4usky','2','1340906904','','http://www.61baobao.com/common/flash/2009/pic/2554.jpg','','0','','http://s.61baobao.com/common/flash/2009/2554.swf','667','479','扁担宽板凳长,扁担想绑在板凳上,<br />扁担宽板凳长,扁担想绑在板凳上,<br />伦敦玛莉莲买了件旗袍送妈妈.<br />莫斯科的夫司基爱上牛肉面疙瘩,<br />各种颜色的皮肤各种颜色的头发,<br />嘴里念的说的开始流行中国话,<br />多少年我们苦练英文发音和文法,<br />这几年换他们卷著舌头学平上去入的变化,<br />平平仄仄平平仄(仄仄平平仄仄平),<br />好聪明的中国人好优美的中国话,<br />扁担宽板凳长,扁担想绑在板凳上,板凳不让扁担绑在板凳上,扁担偏要绑在板凳上,板凳偏偏不让扁担绑在那板凳上,到底扁担宽还是板凳长,<br />哥哥弟弟坡前坐,坡上卧著一只鹅,坡下流著一条河,哥哥说宽宽的河,弟弟说白白的鹅,鹅要过河河要渡鹅,不知是那鹅过河,还是河渡鹅,<br />全世界都在学中国话,孔夫子的话越来越国际化,全世界都在讲中国话,我们说的话让世界都认真听话,<br />纽约苏珊娜开了间禅风lounge bar,柏林来的沃夫冈拿胡琴配著电吉他,各种颜色的皮肤各种颜色的头发,嘴里念的说的开始流行中国话,<br />多少年我们苦练英文发音和文法,这几年换他们卷著舌头学平上去入的变化,平平仄仄平平仄(仄仄平平仄仄平),好聪明的中国人好优美的中国话,<br />有个小孩叫信,上街打醋又买布,买了布打了醋,回头看见鹰抓兔,放下布搁下醋,上前去追鹰和兔,飞了鹰跑了兔,洒了醋湿了布,嘴说腿腿说嘴,<br />嘴说腿爱跑腿,腿说嘴爱卖嘴,光动嘴不动腿,光动腿不动嘴,不如不长腿和嘴,到底是那嘴说腿还是腿说嘴,全世界都在学中国话,<br />孔夫子的话越来越国际化,全世界都在讲中国话,我们说的话让世界都认真听话,全世界都在学中国话,孔夫子的话越来越国际化,全世界都在讲中国话,我们说的话让世界都认真听话,<br />','http://www.61baobao.com/common/flash/2009/dpic/2554.jpg','2554','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTFUSHBKTVU1VVVYVmpNMlJ0','http://s.61baobao.com/common/flash/2009/2554.swf','http://www.61baobao.com/common/flash/2009/dpic/2554.jpg','http://www.61baobao.com/common/flash/2009/pic/2554.jpg','三个月以上','0','0','','0');");
